import { Typography,Grid, TextField, Stack} from '@mui/material';
import CssBaseline from '@mui/material/CssBaseline';
import Divider from '@mui/material/Divider';
import { Box } from '@mui/system';
import Button from '@mui/material/Button';
import React from 'react';

function Todo(props) {
    return (
        <div>
            <Grid container>
                 <Grid sx={{border:"1px solid " ,margin:"auto"}} item xs = {10} sm = {10} md = {6} lg = {6} xl ={6}>

                   <Box>
                    <Box padding ={2} >
                        <Typography>Add A Task</Typography>
                    </Box>
                    <Divider />
                    <Box padding={2}>
                    <Stack spacing={2}>
                          <Typography variant ="h6">Add A Task</Typography>
                          <TextField id="outlined-basic" label="Outlined" variant="outlined"  />
                          <Typography variant ="body1">Enter what you want to submits</Typography>
                        <Button variant="contained" sx={{width:"15%"}}>Send</Button>
                    </Stack>
                    <Box>
                        {/* <Button variant ="contained" >submit</Button> */}
                    </Box>
                    </Box>
                       </Box>  



                 </Grid>
            </Grid>
        </div>
    );
}

export default Todo;
